<div class="card-img"></div>
  <div class="card-info">
    <p class="text-body">Lorem ipsum dolor sit amet consectetur adipisicing elit. Corrupti repellat, consequuntur doloribus voluptate esse iure?</p>
    <p class="text-title">Autor</p>
  </div>
</div>
